import React from 'react';
import TodoItem from './TodoItem';
import TodoForm from './TodoForm';

function TodoList(props) {
  const data = props.data;
  return (
    <div>
      <TodoForm value={data.value} handleTodo={data.handleTodo} />
      {data.todos.map(data => {
        return <TodoItem key={data.id} item={data} handleChange={props.data.handleChange} />
      })}
    </div>
  )
}

export default TodoList;
